import React from 'react';
function ContactUs(){
    return(
        <div className='main-content'>
            <div className='contact'>
                <h2>Contact Us</h2>
                <h3>Contact No.: 1234567890</h3>
                <h3>Email Id: person@gmail.com</h3>
            </div>
        </div>

    )    
}

export default ContactUs;
